import styled from '@emotion/styled'


const Body = styled.div`
    background: #E5E5E5;
` 

const Layout = () => (
    <div>
        Hello
        <style jsx global>{`
            body {
                margin: 0;
                padding: 0;
                background-color: pink;
            }
        `}</style>
        
    </div>
)

export default Layout;
